import React from "react";
import Person from "./Person";

class MainContent extends React.Component {
  constructor(props) {
    super(props);
  }

  getPageType() {
    type = this.props.type;
    switch (type) {
      case type == "Information":
        alert(type);
    }
  }

  render() {
    return (
      <div>
        <p id="content_header">{this.props.type}</p>
        <Person />
        <Person />
        <Person />

        <Person />
        <Person />
        <Person />
      </div>
    );
  }
}

export default MainContent;
